INSERT INTO `quote` VALUES (1,'건강한 신체는 영혼을 위한 침실이지만, 병든 몸은 영혼의 감옥이다. -플란시스 베이컨'),(2,'건강이 재산보다 귀하다. -영국 속담'),(3,'건강을 잃는 것은 과학, 예술, 장점, 재산, 그리고 말재주 등 모든 것을 소용없게 만든다. -헤로필로스'),(4,'건강은 평생 배우며 실천하는 것이다. -토머스 제퍼슨'),(5,'건강을 잃는다면 삶은 더 이상 삶이 아니다. 죽음의 형상인 피로와 고통만 남을 뿐이다. -프랑수아 라블레'),(6,'인간을 죽이는 병도 인간을 지키려는 본능과 똑같은 자연의 힘이다. -조지 산타야나'),(7,'너무 바빠서 자신의 건강을 살피지 않는 사람은 너무 바빠서 자신의 연장을 손질하지 않는 수리공과 같다. -스페인 속담'),(8,'건강은 매우 소중한 것이며, 단 하나밖에 없는 것이다. 실제로 시간과 노력, 그리고 재산뿐 아니라 건강을 얻기 위한 삶 또한 준비해야 건강을 얻을 수 있는 것이다. -미셸 드 몽테'),(9,'최상의 건강에도 한계가 있다. 질병은 늘 우리 가까이에 있다. -아이스킬로스'),(10,'폭식은 모든 병약함과 질병의 원인이다. 기름이 많으면 램프나 불이 꺼지듯, 타고난 육체적 건강도 과도한 식습관으로 나빠질 수 있다. -마리온 L. 버튼');
/*!40000 ALTER TABLE `quote` ENABLE KEYS */;
UNLOCK TABLES;

